import React from 'react'
import MainMenu from './components/Menu.js'
import { Player, ControlBar, BigPlayButton  } from 'video-react'


function App() {
  return (
          <div className = 'App'>
            <MainMenu></MainMenu>
            <Player src='https://media.w3.org/2010/05/sintel/trailer_hd.mp4' width ='600' height = '480'
              fluid = {false} autoPlay = {true}>
              </Player>
          </div>
        );
}

export default App;
